import React from "react";
const ButtonFooter = ({ changeFilter,deteleAllItems ,title, filter, filterExpValue,fetchData}) => {
  return (
    <button
      className={filterExpValue === filter ? "selectedButton" : "footerButton"}
      onClick={()=>{
        changeFilter().then(fetchData)
      }}
    >
      {title}
    </button>
  );
};

export default ButtonFooter;
